import React from 'react'
import IntroOverlay from './../components/intro-Overlay';
import Banner from './../components/banner';
import Cases from './../components/cases';
import { useEffect } from 'react';
import gsap from 'gsap'

function Home() {
            
    useEffect(()=>{
              const tl  = gsap.timeline();
              tl.from(".line span",1.8,{
                y:100,
                ease:"power4.out",
                delay:1,
                skewY:7,
                stagger:{
                  amount:0.3
                }
              }).to(".overlay-top",1.6,{
                height:0,
                ease:"expo.inOut",
                stagger:0.4,
              }).to(".overlay-bottom",1.6,{
                width:0,
                ease:"expo.inOut",
                delay:-.8,
                stagger:{
                  amount:0.4
                }
              }).to(".intro-overlay",0,{
                css:{display:"none"}
              }).from(".case-image img",1.6,{
                scale:1.4,
                ease:"expo.inOut",
                delay:-2,
                stagger:{
                  amount:0.4
                }
              })
            },[])

  return (
    <>
         <IntroOverlay/>
         <Banner/>
         <Cases/>
    </>
  )
}

export default Home
